import React from "react";
import "../css/hero.css";

const Hero = () => {
  return (
    <div className="hero-box">
      <h2>
        Little Lemon
        <h3>Chicago</h3>
        <p>
          Little Lemon is a mediterranean restaurant focused on traditional
          recipes served with a modern twist
        </p>
      </h2>

      <div className="image-hero">Image</div>
    </div>
  );
};

export default Hero;
